import { PopularProductsService } from './../home/popular-products.service';
import { Component, OnInit } from '@angular/core';
import { PopularProducts } from '../home/popular-products';

@Component({
  selector: 'app-products-list',
  templateUrl: './products-list.component.html',
  styleUrls: ['./products-list.component.css']
})
export class ProductsListComponent {
  popularProducts: PopularProducts[] = [];

  constructor(private popularProductsService: PopularProductsService) { }

  ngOnInit(): void {
    this.popularProducts = this.popularProductsService.getPopularProducts()
  }

}
